SELECT COUNT(DISTINCT O_model_list.Model), COUNT(DISTINCT O_car_names.Model) FROM car_names O_car_names JOIN model_list O_model_list ON O_model_list.Model=O_car_names.Model WHERE (SELECT I_car_makers.Id FROM car_makers I_car_makers JOIN car_names I_car_names JOIN cars_data I_cars_data JOIN model_list I_model_list ON I_car_makers.Id=I_model_list.Maker AND I_car_names.MakeId=I_cars_data.Id AND I_model_list.Model=I_car_names.Model WHERE (O_model_list.Maker = I_model_list.Maker AND I_cars_data.Year != 1979.0)) < 12.0
SELECT O_cars_data.Year FROM cars_data O_cars_data WHERE (O_cars_data.Edispl != 351.0 OR (SELECT I_cars_data.Accelerate FROM car_names I_car_names JOIN cars_data I_cars_data ON I_car_names.MakeId=I_cars_data.Id WHERE (O_cars_data.Id = I_cars_data.Id AND (I_car_names.Make NOT LIKE "colt%" OR I_car_names.MakeId != 341.0))) < 8.0)
SELECT O_cars_data.Weight, O_model_list.Maker FROM car_names O_car_names JOIN cars_data O_cars_data JOIN model_list O_model_list ON O_car_names.MakeId=O_cars_data.Id AND O_model_list.Model=O_car_names.Model WHERE (O_model_list.ModelId >= 11.0 AND O_model_list.ModelId < (SELECT I_model_list.ModelId FROM car_names I_car_names JOIN cars_data I_cars_data JOIN model_list I_model_list ON I_car_names.MakeId=I_cars_data.Id AND I_model_list.Model=I_car_names.Model WHERE (O_cars_data.MPG = I_cars_data.MPG AND (I_cars_data.Cylinders = 4.0 OR I_cars_data.Cylinders <= 8.0))))
SELECT * FROM car_names O_car_names WHERE ((O_car_names.Make LIKE "%264gl" OR O_car_names.Model NOT IN "('citroen','plymouth')") AND (SELECT I_car_names.MakeId FROM car_names I_car_names JOIN cars_data I_cars_data ON I_car_names.MakeId=I_cars_data.Id WHERE (O_car_names.Make = I_car_names.Make AND I_cars_data.Horsepower != 84.0)) != 190.0)
SELECT * FROM model_list O_model_list WHERE (O_model_list.Maker IN (SELECT I_model_list.Maker FROM car_names I_car_names JOIN model_list I_model_list ON I_model_list.Model=I_car_names.Model WHERE (O_model_list.ModelId = I_model_list.ModelId AND I_car_names.MakeId = 179.0)) AND O_model_list.ModelId != 12.0)
SELECT COUNT(DISTINCT O_car_makers.Maker) FROM car_makers O_car_makers JOIN continents O_continents JOIN countries O_countries JOIN model_list O_model_list ON O_car_makers.Id=O_model_list.Maker AND O_continents.ContId=O_countries.Continent AND O_countries.CountryId=O_car_makers.Country WHERE ((SELECT I_continents.Continent FROM car_makers I_car_makers JOIN car_names I_car_names JOIN cars_data I_cars_data JOIN continents I_continents JOIN countries I_countries JOIN model_list I_model_list ON I_car_makers.Id=I_model_list.Maker AND I_car_names.MakeId=I_cars_data.Id AND I_continents.ContId=I_countries.Continent AND I_countries.CountryId=I_car_makers.Country AND I_model_list.Model=I_car_names.Model WHERE (O_model_list.Model = I_model_list.Model AND (I_car_makers.Country != 6.0 OR I_cars_data.Id = 401.0))) != "europe" AND (O_continents.Continent = "asia" OR O_model_list.ModelId >= 29.0))
SELECT * FROM car_makers O_car_makers JOIN model_list O_model_list ON O_car_makers.Id=O_model_list.Maker WHERE ((O_car_makers.Country IN (SELECT I_car_makers.Country FROM car_makers I_car_makers JOIN car_names I_car_names JOIN cars_data I_cars_data JOIN model_list I_model_list ON I_car_makers.Id=I_model_list.Maker AND I_car_names.MakeId=I_cars_data.Id AND I_model_list.Model=I_car_names.Model WHERE (O_car_makers.Maker = I_car_makers.Maker AND I_cars_data.Accelerate >= 16.7)) OR O_model_list.Maker = 5.0) OR O_model_list.Maker != 6.0)
SELECT * FROM car_makers O_car_makers JOIN countries O_countries ON O_countries.CountryId=O_car_makers.Country WHERE (O_countries.Continent = 1.0 OR (O_car_makers.Maker != "chrysler" AND O_car_makers.Maker = (SELECT I_car_makers.Maker FROM car_makers I_car_makers JOIN countries I_countries ON I_countries.CountryId=I_car_makers.Country WHERE (O_countries.CountryId = I_countries.CountryId AND (I_countries.CountryId != 2.0 OR (I_car_makers.Country != 1.0 OR I_car_makers.Country = 4.0))))))
SELECT O_countries.CountryName, O_model_list.Maker FROM car_makers O_car_makers JOIN car_names O_car_names JOIN countries O_countries JOIN model_list O_model_list ON O_car_makers.Id=O_model_list.Maker AND O_countries.CountryId=O_car_makers.Country AND O_model_list.Model=O_car_names.Model WHERE ((SELECT I_car_makers.Id FROM car_makers I_car_makers JOIN countries I_countries ON I_countries.CountryId=I_car_makers.Country WHERE (O_car_names.MakeId = I_car_names.MakeId AND I_countries.Continent = 1.0)) > 4.0 OR O_car_names.Make = "ford fiesta")
SELECT O_cars_data.Weight FROM car_makers O_car_makers JOIN car_names O_car_names JOIN cars_data O_cars_data JOIN countries O_countries JOIN model_list O_model_list ON O_car_makers.Id=O_model_list.Maker AND O_car_names.MakeId=O_cars_data.Id AND O_countries.CountryId=O_car_makers.Country AND O_model_list.Model=O_car_names.Model WHERE (O_cars_data.Year >= 1972.0 AND (O_countries.CountryName NOT LIKE "sweden%" OR O_cars_data.Year < (SELECT I_cars_data.Year FROM cars_data I_cars_data WHERE (O_cars_data.Id = I_cars_data.Id AND ((I_cars_data.Accelerate <= 16.6 AND I_cars_data.Edispl >= 400.0) AND I_cars_data.Edispl > 400.0)))))
